import React from 'react';
import coffeecup from '../../vector.png'
// import { Link } from 'react-router-dom'

class NuffCoffeeCup extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      coffeecount: 0
    };
  }
  coffeeCounter = () => {
    console.log(this.state.coffeecount)
    this.setState ({
      coffeecount: this.state.coffeecount+1
    }) 
  }

  render() {
    return(
            <div className="coffeecupcontainer">
              <a onClick={this.coffeeCounter}><NuffCoffeeCup coffee={this.state.coffeecount}/></a>
            </div>)
  }
}
export default NuffCoffeeCup;
